import React, { Component } from 'react';

import { sampleGridConfig } from '../../config/grid';

import Container from './Container';

import * as G from './style';

class Grid extends Component {
  render() {
    return (
      <G.Wrapper id={sampleGridConfig.id} direction={sampleConfig.direction}>
        {sampleConfig.children &&
          sampleConfig.children.map((childConfig, index) => {
            <Container config={childConfig} />;
          })}
      </G.Wrapper>
    );
  }
}

export default Grid;
